import React from "react"
import Data from "./Data"
import './index.css'
function Prodact(){
    let [bol,setbol]=React.useState("")

      const arr=Data.map((el)=>{
        return(
            <>
          <div className="CardList" key={el.id}>
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
            </div>
                <div>   
        
                <button onClick={()=>setbol(el.price)}>To Find Out the Price</button>
                {bol}
             
              </div>
              </>
        )
    
    })
    return(<div>
<div className="List">
    {arr}

</div>
</div>
    )
    }
export default Prodact
